import './css/style.css';

const Header = () => {
  return (
    <div className="header">
    <Logotype />
    <Nav />
    </div>
  );
}

const Logotype = () => {
  return (
    <h1>Учу фронтенд</h1>
  );
}

const Nav = () => {
  return ( 
    <nav>
      <ul>
        <li><a href='#s'>CSS</a></li>
        <li><a href='#s'>JS</a></li>
        <li><a href='#s'>REACT</a></li>
      </ul>
    </nav>
  );
}

export default Header;
